import React , { useState, useEffect } from 'react';
import 'isomorphic-fetch';
import 'es6-promise';
import ReactBootstrap, {InputGroup,FormControl,Nav, Button, Navbar,NavDropdown,Table} from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.min.css';


function OrderMngTable() {

	const [myData,setData] = useState([]);

	useEffect(()=>{

		fetch("dummy.json").then(function(resp){
			return resp.json();
		})
		.then(function(data){
			if(data != myData){
				setData(...myData,data)
				console.log("THIS CONSOLE",data)

			}
		})
		.catch(err => {
          // Do something for an error here
          console.log("Error Reading data " + err);
	})
	},[]);
	console.log("THISIS",myData)
			
	 const renderTable = () => {
	    return myData.map(user => {
	      return (
	        <tr>
	          <td>{user.name}</td>
	          <td>{user.email}</td>
	          <td>{user.address.street}</td> //only street name shown, if you need to show complete address then you need to iterate over `user.address` object
	          <td>{user.company.name}</td> //only company name shown, if you need to show complete company name then you need to iterate over `user.name` object
	        </tr>
	      )
	    })
	  }
	return(
			
